p.x:
var $bm_rt;
var $bm_rt;
var amp, freq, decay, n, n, t, t, v;
amp = 1.5;
freq = 2;
decay = 6;
$bm_rt = $bm_rt = n = 0;
if (numKeys > 0) {
    $bm_rt = $bm_rt = n = nearestKey(time).index;
    if (key(n).time > time) {
        n--;
    }
}
if (n == 0) {
    $bm_rt = $bm_rt = t = 0;
} else {
    $bm_rt = $bm_rt = t = sub(time, key(n).time);
}
if (n > 0 && t < 1) {
    v = velocityAtTime(sub(key(n).time, div(thisComp.frameDuration, 10)));
    $bm_rt = $bm_rt = add(value, div(mul(mul(v, div(amp, 100)), Math.sin(mul(mul(mul(freq, t), 2), Math.PI))), Math.exp(mul(decay, t))));
} else {
    $bm_rt = $bm_rt = value;
}

